import * as Type from "../actions/types";
const initialUserObj = {

    "listOfProject": []
};

export default (state = initialUserObj, action) => {
    switch (action.type) {
        case Type.CREATE_PROJECT:
            return { ...state, projectDetails: action.projectDetails }
        default:
            return { ...state };
    }
};
